import { CommonModule } from '@angular/common';
import { ChangeDetectionStrategy, Component, Input } from '@angular/core';
import { MatIconModule } from '@angular/material/icon';

/**
 * @title Basic icons
 */
@Component({
  selector: 'icon',
  template: `
    <div [ngClass]="classes" class="icon">
      <mat-icon
        aria-hidden="false"
        aria-label="Icon"
        fontIcon="{{ icon }}"
      ></mat-icon>
    </div>
  `,
  styleUrl: './icon.scss',
  standalone: true,
  imports: [CommonModule, MatIconModule],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class Icon {
  @Input() variant: 'primary' | 'danger' | 'warn' | 'success' = 'primary';
  @Input() size: 'xs' | 'm' | 'ml' | 'xl' = 'm';
  @Input() noBackground: boolean = false;
  @Input() icon: string = '';
  /**
   * Classes
   */

  public get variantClasses(): string[] {
    const variantClass = 'icon-' + this.variant;
    const noBackground = this.noBackground ? 'icon-transparent' : '';
    return [variantClass, noBackground];
  }
  public get sizeClasses(): string[] {
    let sizeClass = 'icon-' + this.size;

    return [sizeClass];
  }

  public get classes(): string[] {
    return [...this.variantClasses, ...this.sizeClasses];
  }
}

import { CommonModule } from '@angular/common';
import {
  Component,
  Input,
  ElementRef,
  Renderer2,
  OnInit,
  AfterViewInit,
} from '@angular/core';

@Component({
  selector: 'input-text',
  standalone: true,
  imports: [CommonModule],
  template: `<div class="field" [ngClass]="classes">
    <label *ngIf="label">{{ label }}</label>
    <input #inputElement />
    <p *ngIf="error">{{ errorMessage }}</p>
  </div>`,
  styleUrls: ['./input-text.scss'],
})
export class InputText implements OnInit, AfterViewInit {
  // input attribute
  @Input() type: 'text' | 'email' = 'text';
  @Input() placeholder: string = '';
  @Input() value: string = '';
  @Input() disabled: boolean = false;

  // additional props
  @Input() label?: string;
  @Input() error?: boolean = false;
  @Input() errorMessage?: string;

  constructor(
    private el: ElementRef,
    private renderer: Renderer2
  ) {}

  ngOnInit() {
    const input = this.el.nativeElement.querySelector('input');
    this.renderer.setAttribute(input, 'type', this.type);
    this.renderer.setAttribute(input, 'placeholder', this.placeholder);
    this.renderer.setProperty(input, 'value', this.value);
    this.renderer.setProperty(input, 'disabled', this.disabled);
  }

  ngOnChange() {
    const input = this.el.nativeElement.querySelector('input');
    this.renderer.setAttribute(input, 'type', this.type);
    this.renderer.setAttribute(input, 'placeholder', this.placeholder);
    this.renderer.setProperty(input, 'value', this.value);
    this.renderer.setProperty(input, 'disabled', this.disabled);
  }

  ngAfterViewInit() {
    const input = this.el.nativeElement.querySelector('input');
    for (const key in this.el.nativeElement.attributes) {
      if (this.el.nativeElement.attributes.hasOwnProperty(key)) {
        const attr = this.el.nativeElement.attributes[key];
        this.renderer.setAttribute(input, attr.name, attr.value);
      }
    }
  }

  public get classes(): string[] {
    const errorClass = this.error ? 'error' : '';
    return [errorClass];
  }
}

