            />

            <typo
              *ngIf="!!infoSup"
              text="{{ infoSup }}"
              size="xs"
              variant="{{ progressionClass }}"
            />
          </div>
          <div class="result-ca">
            <typo
              *ngIf="!!resultCA"
              class="bold-weight"
              [text]="resultCA + ''"
              variant="{{ progressionClass }}"
              fontWeight="bold"
            />
          </div>
        </div>
      </div>
      <typo text="Par rapport  la priode prcdente" size="xs" />
